                <p>
                    Bildiyiniz kimi, Ölkədaxili Data Level imtahanları virtual şəkildə keçirilir. Bu baxımdan imtahan başlamazdan əvvəl internetə qoşulmağınıza əmin olmalısınız. İmtahan zamanı Zoom proqramı işə salınmalı və tələbə (sertifikata namizəd) öz ekranını paylaşmalıdı. Zoom proqramını yükləmək və onun vasitəsilə imtahana qoşulmaq qaydası bizim virtual dərslərə qoşulma qaydası ilə eynidir. Bunun üçün ZOOM səhifəsinə daxil olub onu diqqətlə oxuyun. Yeganə fərq ondadır ki, burada mütləq veb kamera ilə qoşulmağı seçməl");
            WriteLiteral(@"isiniz.
